import React from "react";
import { Bar } from "react-chartjs-2";
import moment from "moment";
// import apiManager from "../api/apiManager";

const RouteGraph = (props) => {
  const entries = props.entriesByDate;

  const hour = moment().format("h");
  const roundedMinutes = (
    (Math.round(parseInt(moment().format("mm")) / 10) * 10) %
    60
  ).toString();

  const time = `${hour}:${roundedMinutes}`;

  if (entries[1] !== undefined) {
  console.log((entries[1].time).split(":")[1]);
  }


  entries.forEach((entry) =>
    console.log(((Math.round(parseInt(entry.time.split(":")[1]) / 10) * 10) % 60).toString())
  );

  // console.log(moment().format("YYYY-MM-DD"));
  // console.log("rounded time", time);

  const state = {
    labels: entries.map((entry) => entry.time.slice(0, -3)),
    datasets: [
      {
        backgroundColor: "rgba(75,192,192,1)",
        borderColor: "rgba(0,0,0,1)",
        borderWidth: 2,
        data: entries.map((entry) => entry.attendee_count),
      },
    ],
  };

  return (
    <div>
      <Bar
        data={state}
        options={{
          title: {
            display: true,
            text: "Attendee counts over time",
            fontSize: 20,
          },
          legend: {
            display: false,
          },
          scales: {
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default RouteGraph;
